const products = [];
const ProductReducer = (products = products, action) => {
  switch (action.type) {
    case "FETCH_SUCCESSED":
      return action.receivedProduct;

    case "FETCH_FAILED":
      return action.receivedProduct;

    default:
      return products;
  }
};

export default ProductReducer;
